import React, {useEffect, useState} from 'react';

const SuperBody = React.memo(function(props){

    const [curData, setCurData] = useState([]);
    useEffect(()=>{
        setCurData(props.data)
    }, [props]);

    function dataTablePresentation(data){

        if(data && data === []){
            return <div>empty data</div>;
        }
        else if (data.length > 0){

            let resultArr = [];
            for(let i = 0; i < data.length; i++){
                let tempRow = [];
                let propCounter = 0;
                for(let prop in data[i]){
                    if(prop !== 'address') tempRow.push(<td className={'column_'+prop} key={propCounter++}>{data[i][prop]}</td>);
                    else if(prop === 'address') {
                        // {streetAddress, city, state, zip}
                        let tempAddress = '';
                        for(let position in data[i][prop]){
                            tempAddress += data[i][prop][position] + ' ';
                        }
                        tempRow.push(<td className={'column_'+prop} key={propCounter++}>{tempAddress}</td>);
                    }
                }
                resultArr.push(<tr className={'row '+i} key={i}>{tempRow}</tr>)
            }
            return resultArr
        }
    }

    return <tbody>{/*div body*/}
        {curData && (dataTablePresentation(curData) || <tr><td>body</td></tr>)}
    </tbody>
});

export default SuperBody;
